import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import SearchBar from '../SearchBar/SearchBar.js';
import * as S from './NavBar.styled.js'

export default function NavBar() {
  const location = useLocation();

  return (
    <S.NavBar >
      <S.Buttons> 
        Balance 
      </S.Buttons>

      <SearchBar/>

      <S.Buttons> 
          <Link to='/'>
            <S.Button>
              Home
            </S.Button>
          </Link >

          <S.Link 
            className={ props => {
              return props.isActive ? 'active' : '';
            }}
            end to='/recipe/create'
           >
            <S.Button>
              Create recipe
            </S.Button>
          </S.Link >

      </S.Buttons>
    </S.NavBar>
  )
};
